import React from 'react'
import './custom-button.style.scss'

const CustomButton = ({children, isgogleSignIn, ...otherProps}) => (
    <button className={`${isGoogle}'custom-button'`} {...otherProps}>
        {children}
    </button>
)

export default CustomButton
